import axios from 'axios'
const {URL} = require('./URL')

const getUsersS = async(data) => {
  console.log('-------------------->',URL);
  // const response = await axios.get(`${URL}/user/get`, data)
  const response = await axios.get("http://localhost:4000/user/get")
  return response.data
}

const createAccount = async(data) => {
  const response = await axios.post(`${URL}/user/create`, data)
  return response.data
}

const userService = {
  createAccount,
  getUsersS
}

export default userService
